import './App.css';

function AppAssetList() {
  return (
    <div className='App'>
      <header className='App-header'>
        <a
          className='App-logo'
          href='/'
          target='_self'
          rel='noopener noreferrer'
        >
          CodeTrackr
        </a>
        <button>Novo Ativo</button>
      </header>
    </div>
  )
}

export default AppAssetList;
